import React, { component } from 'react';
import './Product.css';
import { render } from '@testing-library/react';

export default function PriceFilter(props) {
    return (
        <div>
            <h4>Price</h4>
            <label for="price-low">Low</label><input />

            <label for ="price-high">High</label><input />
        </div>
    )
};
